import React from 'react'
// import {Link} from 'react-router-dom'

const ShopItem = ({match, EntriesDetails}) => {

    const {items} = EntriesDetails;

    const {name} = items.name;
    
    const {} = items
    return (
        <div>
            {items.map((item, i) => {
                return <p>{item.name}</p>
            })}
        </div>
    )
}

export default ShopItem
